% Frequência de amostragem (Hz)
Fs = 100;

% Número de pontos
N = length(x);

% Calcular FFT
X = fft(x);

% Calcular vetor de frequências (apenas até a metade, para sinais reais)
f = (0:floor(N/2)) * Fs / N;

% Calcular magnitude normalizada da FFT (apenas metade positiva)
magnitude = abs(X(1:floor(N/2)+1)) / N;

% Para sinais reais, dobrar a magnitude, exceto nos extremos
